pub fn cosine_similarity(a: &[f32], b: &[f32]) -> f32 { let dot: f32 = a.iter().zip(b).map(|(x, y)| x * y).sum(); let norm_a: f32 = a.iter().map(|x| x * x).sum::<f32>().sqrt(); let norm_b: f32 = b.iter().map(|x| x * x).sum::<f32>().sqrt(); dot / (norm_a * norm_b)
} pub struct VectorIndex { embeddings: Vec<Embedding>,
} impl VectorIndex { pub fn search(&self, query: &[f32], k: usize) -> Vec<SearchResult> { let mut results: Vec<_> = self.embeddings.iter() .map(|e| (e.id.clone(), cosine_similarity(query, &e.vector))) .collect(); results.sort_by(|a, b| b.1.partial_cmp(&a.1).unwrap()); results.into_iter().take(k).collect() }
}

